    true,nt"url": null,nt"notes": "The GPM Ground Validation NEXRAD IFloodS
    datasets were collected from four sites during March 29, 2013 to June 18, 2013 for
    the GPM Iowa Flood Studies (IFloodS) which occurred in eastern Iowa. The Next Generation
    Weather Radar system (NEXRAD) comprises more than 159 Weather Surveillance Radar-1988
    Doppler (WSR-88D) sites throughout the United States and select overseas locations.
    The GPM Ground Validation NEXRAD IFloodS data files are available as Level 2 binary
    files, and provide radar reflectivity.",nt"license_title": "U.S. Government
